window.bookSummaryJSON = "<p><b>Betrayed and killed by the god destined to love her</b></p> <p>He was meant to be her lover, but he would rather see the Omega dead than surrender to Fate's snare.</p> <p>No one escapes the Realm of Death, but if Annabel doesn't find a way out, her mates will die along with her, and Ragnarök will leave nothing behind but darkness and ashes.</p> <p>Her only hope is to win the heart of the god who killed her. But even if she can trick her way into his icy soul, can she ever love a man whose hatred for her reaches back to the moment of her birth?</p> <p><b>Contains mature themes.</b></p>"; 
